import styled from "styled-components";

export const Button = styled.button`
  width: 100%;
  height: 100%;
  text-align: center;
  cursor: pointer;
  background-color: #108CFF;
  color: white;
  border-radius: 10px;
  font-size: 18px;
  font-family: "Roboto-Bold";
  border: none;

`;

export default Button;
